-- Table: accounts_audit_log
CREATE TABLE `accounts_audit_log` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `action` varchar(10) NOT NULL,
  `view_name` varchar(255) NOT NULL,
  `path` varchar(255) NOT NULL,
  `method` varchar(10) NOT NULL,
  `model_name` varchar(255) NOT NULL,
  `object_id` varchar(255) DEFAULT NULL,
  `timestamp` datetime(6) NOT NULL,
  `details` longtext NOT NULL,
  `changes` json DEFAULT NULL,
  `ip_address` char(39) DEFAULT NULL,
  `browser` varchar(255) NOT NULL,
  `status_code` int DEFAULT NULL,
  `related_object` varchar(255) DEFAULT NULL,
  `user_id` bigint DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- Table: django_migrations
CREATE TABLE `django_migrations` (
  `id` int NOT NULL AUTO_INCREMENT,
  `app` varchar(255) NOT NULL,
  `name` varchar(255) NOT NULL,
  `applied` datetime(6) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;


-- Table: version_tracker_appversion
CREATE TABLE `version_tracker_appversion` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `app_name` varchar(100) COLLATE utf8mb4_unicode_ci NOT NULL,
  `version_number` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `version_type` varchar(10) COLLATE utf8mb4_unicode_ci NOT NULL,
  `release_date` datetime(6) NOT NULL,
  `code_hash` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `changed_files` json NOT NULL,
  `system_info` json NOT NULL,
  `author_id` bigint NOT NULL,
  `major` int unsigned NOT NULL DEFAULT '0',
  `minor` int unsigned NOT NULL DEFAULT '0',
  `patch` int unsigned NOT NULL DEFAULT '0',
  `build` int unsigned NOT NULL DEFAULT '0',
  `previous_version_id` bigint DEFAULT NULL,
  `is_final` tinyint(1) NOT NULL DEFAULT '0',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_version` (`app_name`,`major`,`minor`,`patch`,`build`),
  KEY `idx_app_name` (`app_name`),
  KEY `idx_version_number` (`version_number`),
  KEY `idx_release_date` (`release_date`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


-- Table: version_tracker_codechangelog
CREATE TABLE `version_tracker_codechangelog` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `version_id` bigint NOT NULL,
  `file_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `change_type` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `change_date` datetime(6) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_version_file` (`version_id`,`file_name`),
  KEY `idx_version` (`version_id`),
  KEY `idx_change_date` (`change_date`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


-- Table: version_tracker_filehash
CREATE TABLE `version_tracker_filehash` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `app_version_id` bigint NOT NULL,
  `file_path` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `hash_value` varchar(64) COLLATE utf8mb4_unicode_ci NOT NULL,
  `timestamp` datetime(6) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_file_version` (`app_version_id`,`file_path`),
  KEY `idx_app_version` (`app_version_id`),
  KEY `idx_timestamp` (`timestamp`)
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


-- Table: version_tracker_finalversion
CREATE TABLE `version_tracker_finalversion` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `version_number` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `release_date` datetime(6) NOT NULL,
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  KEY `idx_release_date` (`release_date`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


-- Table: version_tracker_finalversion_app_versions
CREATE TABLE `version_tracker_finalversion_app_versions` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `finalversion_id` bigint NOT NULL,
  `appversion_id` bigint NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `unique_final_app` (`finalversion_id`,`appversion_id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

